      ctx.lineTo(565.6, 532.8);
      ctx.lineTo(565.6, 555.7);
      ctx.closePath();
      ctx.fillStyle = "rgb(180, 44, 58)";
      ctx.fill();

      // menu/back to menu
      ctx.font = "22.0px 'American Captain'";
      ctx.fillStyle = "rgb(231, 222, 183)";
      ctx.fillText("back to menu", 463.1, 552.1);
      ctx.restore();
    }

    function menuSpot(ctx) {

      // menuSpot/Path
      ctx.save();
      ctx.beginPath();
      ctx.moveTo(565.6, 555.7);
      ctx.lineTo(458.4, 555.7);
      ctx.lineTo(458.4, 532.8);
      ctx.lineTo(565.6, 532.8);
      ctx.lineTo(565.6, 555.7);
      ctx.closePath();
      ctx.restore();
    }
  </script>
